// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import {TokenTransferProxy} from './TokenTransferProxy.sol';
import {ProxyRegistry} from './ProxyRegistry.sol';


contract ElementixTokenTransferProxy is TokenTransferProxy {

    string public constant name = "Elementix TokenTransferProxy";
    string public constant version = "1.0";

    constructor (ProxyRegistry registryAddr)
    {
        registry = registryAddr;
    }

}
